pragma solidity ^0.5.16;

contract TradingContract {
    address public admin;
    address public feeaccount;
    address public accountlevelsaddr;
    uint256 public feemake;
    uint256 public feetake;
    uint256 public feerebate;
    mapping (address => mapping (address => uint256)) public balanceof;
    mapping (address => uint256) public orders;
    mapping (address => uint256) public orderfills;

    constructor() public {
        admin = msg.sender;
        feeaccount = msg.sender;
    }

    function changeAdmin(address _admin) public {
        require(msg.sender == admin, "Only admin can change admin");
        admin = _admin;
    }

    function changeFeeAccount(address _feeaccount) public {
        require(msg.sender == admin, "Only admin can change fee account");
        feeaccount = _feeaccount;
    }

    function changeAccountLevelsAddr(address _accountlevelsaddr) public {
        require(msg.sender == admin, "Only admin can change account levels address");
        accountlevelsaddr = _accountlevelsaddr;
    }

    function changeFeeMake(uint256 _feemake) public {
        require(msg.sender == admin, "Only admin can change fee make");
        feemake = _feemake;
    }

    function changeFeeTake(uint256 _feetake) public {
        require(msg.sender == admin, "Only admin can change fee take");
        feetake = _feetake;
    }

    function changeFeeRebate(uint256 _feerebate) public {
        require(msg.sender == admin, "Only admin can change fee rebate");
        feerebate = _feerebate;
    }

    function deposit() public payable {
        balanceof[address(0)][msg.sender] += msg.value;
    }

    function withdraw(uint256 amount) public {
        require(balanceof[address(0)][msg.sender] >= amount, "Insufficient balance");
        balanceof[address(0)][msg.sender] -= amount;
        msg.sender.transfer(amount);
    }

    function order(address tokenGet, uint256 amountGet, address tokenGive, uint256 amountGive, uint256 expires, uint256 nonce) public {
        bytes32 hash = sha256(abi.encodePacked(this, tokenGet, amountGet, tokenGive, amountGive, expires, nonce));
        orders[msg.sender] = uint256(hash);
    }

    // Other functions omitted for brevity.
}
```

